/** @format */

import React from 'react';
import { HealthList } from '../TextInfo';
import '../App.css';
import Swipe from '../components/Swipe';

const HealthBlock = ( i ) => {
    i = i.i;
    const item = HealthList[i];
    // const background = {
    //     backgroundImage: `url(../images/suppliersLogo/${item.img[0]})`,
    // };
    return (
        <span>
            <div style={{ display: "flex", justifyContent: "center", marginBottom: "5vh" }}>
                <Swipe path="healthPhotos" />
            </div>
            <h3 style={{ backgroundColor: "lightgray" }}>{item.title}</h3>
            <p>{item.subtitle}</p>

        </span>
    );
};

export default HealthBlock;
